Ας υποθέσουμε ότι Έτσι, δεν μπορώ να δεχθώ την πηγή του Hendrickson για την προέλευση των αλόγων, όμως, για να του αποδώσω το χρέος του, αντιγράφει μόνο την ετυμολογία από άλλες πηγές, συμπεριλαμβανομένου του λεξικού OED. Μπορούμε να συμπεράνουμε ότι "Δεν συμφωνώ με τον Hendrickson για τις ζώνες υποτροπικών νηνεμιών."; Ναι, όχι, ή ίσως;
['Ναί', 'yes', 'true']

Ας υποθέσουμε ότι Η τελευταία φράση Υποθέτουμε βεβαία ότι δεν έχετε υποβάλει αλλού αυτή την έκθεση. Μπορούμε να συμπεράνουμε ότι "Θεωρούμε ότι δεν έχετε παρουσιάσει αυτή την εργασία σε κανέναν άλλο."; Ναι, όχι, ή ίσως;
['Ναί', 'yes', 'true']

Ας υποθέσουμε ότι Φωτογραφία του Μπιλ Κλίντον στον Πίνακα Περιεχομένων της Λίστας Υποψηφίων από τον Kevin Lamarque / Reuters. Μπορούμε να συμπεράνουμε ότι "Ο Κέβιν Λαμάρκ έχει τραβήξει αρκετές φωτογραφίες τον Μπιλ Κλίντον συμπεριλαμβανόμενης και εκείνης στο αρχείο Slate Table of Contents."; Ναι, όχι, ή ίσως;
['Μπορεί']

Ας υποθέσουμε ότι Δεν έχουμε ανακαλύψει στοιχεία που να αποδεικνύουν ότι η KSM ήταν παρούσα στον ξενώνα στο Ισλαμαμπάντ, όπου συνέβη η σύλληψη του Yousef, όπως υπονοήθηκε στον Τύπο. Μπορούμε να συμπεράνουμε ότι "Ο Yousef συνελήφθη."; Ναι, όχι, ή ίσως;
['Ναί', 'yes', 'true']

Ας υποθέσουμε ότι Πόσο χρονών είναι οι νέοι; Μπορούμε να συμπεράνουμε ότι "Οι νέοι είναι όλοι κάτω από είκοσι πέντε ετών."; Ναι, όχι, ή ίσως;
['Μπορεί']

Ας υποθέσουμε ότι Δεν υπάρχει διαφορά μεταξύ των νεότερων και των μεγαλύτερων συμμαθητών στις βαθμολογίες των τεστ προόδου. Μπορούμε να συμπεράνουμε ότι "Οι νέοι και οι μεγάλοι μαθητές έχουν διαφορετικά αποτελέσματα εξετάσεων καθώς η ηλικία είναι ένας παράγοντας"; Ναι, όχι, ή ίσως;
['Οχι', 'no', 'false']

Ας υποθέσουμε ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Μπορούμε να συμπεράνουμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
